INSERT INTO `hospital_personal_departamento` (`id`, `nombre_departamento`, `tipo`, `descripcion`) VALUES
	(1, 'Urgencias (Emergencias)', 'Atención de urgencias médicas.', 'Este departamento se encarga de la atención inmediata a pacientes que presentan situaciones críticas o repentinas, como accidentes, dolor agudo, hemorragias, problemas respiratorios, etc. Funciona las 24 horas del día.'),
	(2, 'Consultas Externas (Consultorios)', 'Atención ambulatoria.', 'Es el departamento donde los pacientes reciben atención médica de manera ambulatoria, sin necesidad de ser hospitalizados. Se realizan consultas generales y especializadas para diagnóstico y seguimiento de enfermedades.'),
	(3, 'Cirugía', 'Atención quirúrgica.', 'Departamento especializado en realizar intervenciones quirúrgicas tanto programadas como de emergencia. Aquí se operan una variedad de condiciones, desde procedimientos menores hasta cirugías mayores.'),
	(4, 'Unidad de Cuidados Intensivos (UCI)', 'Cuidados críticos.', 'Este departamento se encarga de la atención de pacientes en estado crítico o grave que requieren monitoreo constante y tratamientos especializados, como ventilación mecánica, apoyo cardiovascular, etc.'),
	(5, 'Radiología y Diagnóstico por Imagen', 'Diagnóstico por imagen.', 'Departamento encargado de realizar estudios de diagnóstico como radiografías, tomografías, resonancias magnéticas, ecografías y otros, para ayudar en la detección y diagnóstico de enfermedades y lesiones.'),
	(6, 'Laboratorio Clínico', 'Análisis clínicos.', 'Aquí se realizan análisis de muestras biológicas (sangre, orina, tejidos, etc.) para obtener diagnósticos precisos de diversas condiciones médicas. Incluye pruebas de laboratorio para infecciones, enfermedades metabólicas, y más.'),
	(7, 'Farmacia', 'Dispensa de medicamentos.', 'En este departamento se gestionan y distribuyen los medicamentos tanto para pacientes hospitalizados como ambulatorios. Los farmacéuticos asesoran sobre el uso adecuado de medicamentos y gestionan el inventario.'),
	(8, 'Oncología', 'Tratamiento del cáncer.', 'Especializado en el diagnóstico, tratamiento y seguimiento de pacientes con cáncer. Este departamento maneja quimioterapia, radioterapia, cirugía oncológica, y cuidado paliativo, entre otros.'),
	(9, 'Pediatría', 'Medicina infantil.', 'En este departamento se ofrece atención médica a niños, desde recién nacidos hasta adolescentes. Se tratan enfermedades específicas de la infancia, seguimiento del crecimiento y desarrollo, y vacunación.'),
	(10, 'Ginecología y Obstetricia', 'Salud reproductiva femenina.', 'Se enfoca en el cuidado de la salud reproductiva de la mujer, incluyendo la atención durante el embarazo, el parto, la posparto, así como la prevención y tratamiento de enfermedades ginecológicas.'),
	(11, 'Dermatología', 'Enfermedades de la piel.', 'Especializado en el diagnóstico y tratamiento de enfermedades de la piel, cabello y uñas, tales como acné, psoriasis, dermatitis, cáncer de piel, y trastornos estéticos.'),
	(12, 'Cardiología', 'Especialidad Clínica', 'El Departamento de Cardiología se encarga del diagnóstico, tratamiento y seguimiento de enfermedades cardiovasculares. Atiende pacientes con patologías como hipertensión, insuficiencia cardíaca, arritmias, cardiopatías congénitas y enfermedad coronaria, entre otras.\r\n\r\nOfrece estudios como electrocardiograma, ecocardiograma, monitoreo Holter, pruebas de esfuerzo (ergometría) y control de marcapasos. Brinda atención ambulatoria, internación en unidad coronaria y participa activamente en programas de prevención cardiovascular.'),
	(13, 'Endocrinología y Metabolismo', 'Clínico', 'El departamento de Endocrinología y Metabolismo se encarga del diagnóstico, tratamiento y seguimiento de enfermedades relacionadas con las glándulas endocrinas y los trastornos metabólicos. Incluye patologías como diabetes, enfermedades tiroideas, trastornos hormonales y desórdenes metabólicos. Trabaja en conjunto con el laboratorio de endocrinología para ofrecer análisis especializados y brindar un tratamiento integral a los pacientes.'),
	(14, 'Microbiología y Bacteriología', 'Clínico', 'El departamento de Microbiología y Bacteriología se dedica al diagnóstico, estudio y control de enfermedades infecciosas causadas por bacterias y otros microorganismos. Colabora estrechamente con laboratorios clínicos para realizar cultivos, pruebas de sensibilidad y estudios epidemiológicos que permiten un manejo adecuado de las infecciones en los pacientes.'),
	(15, 'Neumología', 'Clínico', 'Este es el área principal donde se gestionan los estudios y diagnósticos relacionados con el sistema respiratorio, incluyendo enfermedades como asma, EPOC (enfermedad pulmonar obstructiva crónica), neumonía, fibrosis pulmonar, tuberculosis, entre otras. En este departamento se realizan consultas, estudios diagnósticos y seguimientos de los pacientes con problemas respiratorios.'),
	(16, 'Diagnostico', 'Clínico', 'Este Departamento trabaja estrechamente con otros servicios como cirugía, oncología, ginecología y medicina interna, ya que se encarga del estudio de muestras de tejido (biopsias, piezas quirúrgicas, citologías) para establecer diagnósticos.'),
	(17, 'Neurología', 'Clinico', 'El Departamento de Neurología es la unidad médico-asistencial especializada en la prevención, diagnóstico, tratamiento y seguimiento de enfermedades que afectan al sistema nervioso central y periférico, incluyendo el cerebro, médula espinal, nervios y músculos.'),
	(18, 'Unidad de Recuperación Postquirúrgica (PACU)', 'Asistencial', 'La Unidad de Recuperación Postquirúrgica es el espacio donde los pacientes son trasladados inmediatamente después de una cirugía, para ser monitoreados y estabilizados durante el proceso de recuperación de la anestesia.'),
	(19, 'Anestesiología', 'Clínico', 'El Departamento de Anestesiología es responsable de planificar, administrar y supervisar la anestesia en pacientes que se someten a procedimientos quirúrgicos, diagnósticos o terapéuticos. Además, este departamento tiene un papel fundamental en el manejo del dolor agudo y crónico, así como en el soporte vital en situaciones críticas.'),
	(20, 'Patología', 'Clínico y de laboratorio', 'El Departamento de Patología es responsable de la evaluación diagnóstica de muestras biológicas (tejidos, fluidos corporales, células) para identificar enfermedades, orientar tratamientos y apoyar la toma de decisiones clínicas. Es fundamental para el diagnóstico definitivo en muchas enfermedades, incluyendo infecciones, cánceres, trastornos inflamatorios y genéticos.'),
	(21, 'Nefrología', 'Clínico', 'El Departamento de Nefrología se encarga del estudio y tratamiento de las patologías que afectan la función renal, incluyendo enfermedades agudas y crónicas, así como el manejo de la insuficiencia renal. Además, supervisa terapias de sustitución renal como la diálisis y la preparación para el trasplante renal.'),
	(22, 'Gastroenterología', 'Clínico', 'El Departamento de Gastroenterología se encarga del estudio y tratamiento de las patologías que afectan el tracto gastrointestinal, que incluye esófago, estómago, intestinos, hígado, páncreas y vías biliares. Además, realiza procedimientos diagnósticos y terapéuticos como endoscopias.'),
	(23, 'Reumatología', 'Clínico', 'El Departamento de Reumatología se enfoca en el estudio y tratamiento de enfermedades reumáticas, que incluyen trastornos inflamatorios, degenerativos y autoinmunes. Estos trastornos afectan principalmente las articulaciones y el sistema musculoesquelético, pero también pueden comprometer órganos internos.'),
	(24, 'Psiquiatría', 'Clínico', 'El Departamento de Psiquiatría se encarga de la atención integral de pacientes con enfermedades mentales, proporcionando evaluación clínica, terapias farmacológicas y psicoterapéuticas. También trabaja en la prevención, rehabilitación y promoción de la salud mental.'),
	(25, 'Cuidados Paliativos', 'Clínico', 'El Departamento de Cuidados Paliativos se enfoca en el alivio del dolor y otros síntomas en pacientes con enfermedades que no responden a tratamientos curativos, como el cáncer avanzado, enfermedades neurológicas degenerativas, insuficiencias orgánicas crónicas, entre otras.\r\n\r\nEste departamento no busca curar la enfermedad, sino mejorar la calidad de vida del paciente y su familia, promoviendo una atención digna, humanizada y respetuosa durante el proceso de enfermedad avanzada o en el final de la vida.'),
	(26, 'Otorrinolaringología', 'Clínico-quirúrgico', 'El Departamento de Otorrinolaringología se dedica a tratar afecciones que afectan los órganos sensoriales y las vías respiratorias superiores, incluyendo problemas auditivos, de equilibrio, respiración nasal, deglución, habla y voz. Además, maneja quirúrgicamente enfermedades de cabeza y cuello, incluyendo tumores benignos o malignos.'),
	(27, 'Oftalmología', 'Clínico-quirúrgico', 'El Departamento de Oftalmología se dedica a la atención integral de la salud visual, incluyendo el diagnóstico y tratamiento médico y quirúrgico de enfermedades oculares, así como la prevención de la ceguera y el cuidado de la visión.'),
	(28, 'Alergología', 'Clínico', 'El Departamento de Alergología se encarga del estudio y tratamiento de las reacciones alérgicas, que pueden afectar diferentes órganos y sistemas, como la piel, las vías respiratorias, el aparato digestivo y en casos severos, provocar anafilaxia. También aborda trastornos relacionados con el sistema inmunológico.'),
	(29, 'Salas administrativas', 'Administrativo', 'Estas salas están destinadas a las actividades administrativas y de gestión hospitalaria, donde se planifican, organizan y supervisan procesos relacionados con recursos humanos, finanzas, logística, atención al paciente y otras áreas operativas esenciales para el funcionamiento eficaz del centro de salud.'),
	(30, 'Banco de Sangre', 'Clínico', 'El Banco de Sangre se encarga de garantizar la disponibilidad y seguridad de la sangre y sus derivados, cumpliendo con estrictos controles para evitar reacciones transfusionales y transmisión de enfermedades. Además, realiza pruebas de compatibilidad y estudios inmunohematológicos.'),
	(31, 'Urología', 'Especialidad Quirúrgica', 'El Departamento de Urología se encarga del diagnóstico, tratamiento médico y quirúrgico de las enfermedades del sistema urinario en hombres y mujeres, así como del aparato reproductor masculino. Atiende patologías como infecciones urinarias, cálculos renales, problemas prostáticos, cáncer urológico y trastornos funcionales del tracto urinario. Proporciona atención integral en consultorios externos, hospitalización y procedimientos quirúrgicos.'),
	(32, 'Traumatología', 'Médico-quirúrgico', 'El departamento se encarga de atender todo tipo de traumatismos o lesiones físicas, ya sea por accidentes, caídas, fracturas, luxaciones, esguinces o daños deportivos. Los especialistas, llamados traumatólogos u ortopedistas, utilizan tratamientos que pueden ser conservadores (como inmovilización con yeso o férulas, fisioterapia) o quirúrgicos (como reducción de fracturas, colocación de clavos o prótesis). También se ocupa de la rehabilitación para que los pacientes recuperen movilidad y fuerza');
INSERT INTO `hospital_personal_especialidades` (`id`, `nombre_especialidad`, `descripcion`, `permite_turno`, `departamento_id`, `capacidad_diaria`) VALUES
	(1, 'Medicina de Urgencias', 'Especialidad que se ocupa de la atención inmediata a pacientes en situaciones de emergencia y urgencias médicas, como accidentes o enfermedades repentinas.', 0, 1, 80),
	(2, 'Trauma y Cirugía de Urgencias', 'Especialidad centrada en el manejo de traumas y lesiones en situaciones de emergencia que requieren intervención quirúrgica urgente.', 0, 1, 50),
	(3, 'Medicina General', 'Especialidad que se encarga de la atención primaria de la salud, diagnóstico y tratamiento de enfermedades comunes y prevención.', 1, 2, 60),
	(4, 'Pediatría', 'Especialidad que se dedica a la atención médica de niños y adolescentes, desde el nacimiento hasta la adolescencia.', 1, 9, 40),
	(6, 'Dermatología', 'Especialidad que diagnostica y trata las enfermedades de la piel, cabello y uñas, incluyendo enfermedades dermatológicas comunes y estéticas.', 1, 11, 25),
	(7, 'Cirugía General', 'Especialidad que se enfoca en el tratamiento quirúrgico de diversas patologías, incluyendo intervenciones en órganos y tejidos internos.', 0, 3, 20),
	(8, 'Cirugía Oncológica', 'Especialidad quirúrgica que se dedica al diagnóstico y tratamiento quirúrgico del cáncer en diversas partes del cuerpo.', 0, 3, 15),
	(9, 'Cirugía Vascular', 'Especialidad que aborda las enfermedades de los vasos sanguíneos, mediante procedimientos quirúrgicos.', 0, 3, 15),
	(10, 'Medicina Crítica', 'Especialidad médica que se encarga del manejo de pacientes en estado crítico, incluyendo soporte vital y monitoreo intensivo.', 0, 4, 10),
	(11, 'Anestesiología', 'Especialidad médica que se ocupa de la administración de anestesia y el manejo del dolor en procedimientos quirúrgicos o críticos.', 0, 19, 12),
	(12, 'Radiología intervencionista', 'Especialidad médica que realiza procedimientos mínimamente invasivos guiados por imágenes (rayos X, ecografía, tomografía, resonancia) para diagnosticar y tratar diversas patologías, permitiendo atención directa del paciente sin necesidad de cirugía abierta.', 1, 2, 20),
	(13, 'Patología', 'Especialidad médica que se ocupa del diagnóstico de enfermedades a través de análisis de muestras biológicas.', 0, 20, 30),
	(14, 'Microbiología', 'Especialidad enfocada en el diagnóstico de infecciones mediante análisis microbiológicos de muestras de sangre, orina, etc.', 0, 14, 30),
	(15, 'Oncología Médica', 'Especialidad que trata el cáncer mediante quimioterapia, terapias biológicas y seguimiento de pacientes con cáncer en todas sus fases.', 1, 8, 20),
	(16, 'Oncología Ginecológica', 'Especialidad médica que trata los cánceres relacionados con el aparato reproductivo femenino, como cáncer de ovario y de cuello uterino.', 1, 8, 15),
	(17, 'Neonatología', 'Especialidad médica que se ocupa del cuidado de recién nacidos, especialmente aquellos que nacen prematuramente o con enfermedades.', 1, 9, 20),
	(18, 'Obstetricia', 'Especialidad que se ocupa del manejo del embarazo, el parto y el postparto, incluyendo la salud de la madre y el bebé.', 1, 10, 40),
	(19, 'Ginecología', 'Especialidad médica que se encarga del diagnóstico y tratamiento de enfermedades del aparato reproductivo femenino, incluyendo trastornos menstruales y cáncer ginecológico.', 1, 10, 30),
	(20, 'Dermatología Estética', 'Especialidad que trata las afecciones estéticas de la piel, cabello y uñas, como rejuvenecimiento facial, tratamientos contra la caída del cabello, etc.', 1, 11, 15),
	(21, 'Cirugía Dermatológica', 'Especialidad quirúrgica que se ocupa de realizar procedimientos en la piel, como la eliminación de tumores cutáneos, tratamiento de cicatrices, etc.', 0, 11, 10),
	(22, 'Medicina de Emergencias Pediátricas', 'Especialidad que se ocupa de la atención de emergencias médicas en niños, considerando sus necesidades específicas.', 0, 1, 30),
	(23, 'Medicina de Desastres', 'Especialidad que se encarga de la atención de emergencias y desastres masivos, como accidentes múltiples, desastres naturales, etc.', 0, 1, 25),
	(24, 'Cardiología', 'Especialidad que se dedica a diagnosticar y tratar enfermedades del corazón y del sistema circulatorio.', 1, 12, 35),
	(25, 'Neumología', 'Especialidad que se ocupa de las enfermedades respiratorias, como el asma, bronquitis crónica, neumonía, entre otras.', 1, 15, 25),
	(26, 'Endocrinología', 'Especialidad médica que trata trastornos hormonales y metabólicos, como diabetes, hipotiroidismo, etc.', 1, 13, 20),
	(27, 'Oftalmología', 'Especialidad que se dedica al diagnóstico y tratamiento de enfermedades y trastornos visuales.', 1, 27, 25),
	(28, 'Otorrinolaringología', 'Especialidad que se enfoca en el diagnóstico y tratamiento de enfermedades relacionadas con los oídos, nariz y garganta.', 1, 26, 25),
	(29, 'Urología', 'Especialidad que trata enfermedades del sistema urinario y los órganos reproductores masculinos, incluyendo problemas renales y de próstata.', 1, 31, 20),
	(30, 'Reumatología', 'Especialidad médica que diagnostica y trata enfermedades autoinmunes y enfermedades musculoesqueléticas como artritis y lupus.', 1, 23, 15),
	(31, 'Gastroenterología', 'Especialidad dedicada al diagnóstico y tratamiento de enfermedades del aparato digestivo, incluyendo el hígado, páncreas y colon.', 1, 22, 20),
	(32, 'Neurología', 'Especialidad médica que se ocupa de los trastornos del sistema nervioso central y periférico, como accidentes cerebrovasculares, esclerosis múltiple, etc.', 1, 17, 15),
	(33, 'Cirugía Torácica', 'Especialidad quirúrgica que se ocupa del tratamiento de enfermedades del tórax, incluidos los pulmones y el corazón.', 1, 3, 10),
	(34, 'Cirugía Plástica y Estética', 'Especialidad que se dedica a la reparación de tejidos y a los procedimientos estéticos reconstructivos.', 1, 3, 10),
	(35, 'Ortopedia', 'Especialidad que trata problemas musculoesqueléticos, incluyendo fracturas, deformidades y trastornos articulares.', 1, 3, 15),
	(36, 'Cuidados Intensivos Neurológicos', 'Especialidad que se ocupa del tratamiento de pacientes con trastornos neurológicos graves, como traumatismos craneoencefálicos o ACVs.', 0, 4, 10),
	(37, 'Cuidados Paliativos', 'Especialidad que se centra en el alivio del dolor y el sufrimiento de pacientes con enfermedades terminales o crónicas.', 1, 25, 10);
INSERT INTO `hospital_personal_serviciodiagnostico` (`id`, `nombre_servicio`, `descripcion`, `departamento_id`, `capacidad_diaria`) VALUES
	(1, 'Rayos X', 'Servicio encargado de realizar radiografías para diagnóstico de fracturas, hemorragias internas y otras condiciones.', 5, 50),
	(2, 'Ecografía de Emergencia', 'Servicio que realiza ecografías para detectar patologías abdominales, hemorrágicas y otras urgencias médicas.', 1, 30),
	(4, 'Pruebas de Laboratorio Clínico', 'Servicio que realiza análisis de muestras biológicas (sangre, orina, etc.) para diagnóstico de diversas condiciones médicas.', 6, 100),
	(5, 'Electrocardiograma (ECG)', 'Servicio de diagnóstico que utiliza un electrocardiograma para estudiar la actividad eléctrica del corazón y detectar arritmias u otras enfermedades.', 12, 60),
	(6, 'Ecografía General', 'Servicio encargado de realizar ecografías abdominales, ginecológicas, musculoesqueléticas, entre otras, para diagnóstico no invasivo.', 5, 40),
	(7, 'Pruebas de Función Pulmonar', 'Servicio que evalúa la función de los pulmones y el sistema respiratorio, usado en neumología y enfermedades respiratorias.', 15, 25),
	(8, 'Endoscopia Digestiva', 'Servicio para examinar el tracto gastrointestinal mediante un endoscopio, útil en la diagnóstico de problemas gástricos y colonoscopia.', 22, 15),
	(9, 'Audiometría', 'Prueba de diagnóstico utilizada para evaluar la capacidad auditiva del paciente.', 26, 20),
	(10, 'Examen Visual', 'Exámenes oftalmológicos para evaluar la salud ocular, visión, y detectar enfermedades como cataratas o glaucoma.', 27, 30),
	(11, 'Pruebas de Alergia', 'Servicios de diagnóstico para identificar alergias a alimentos, medicamentos, sustancias ambientales, entre otros.', 28, 20),
	(12, 'Radiología Quirúrgica', 'Servicio de diagnóstico por imagen especializado para guiar intervenciones quirúrgicas y verificar lesiones antes y después de la cirugía.', 5, 10),
	(13, 'Tomografía Computarizada (TAC)', 'Servicio avanzado de diagnóstico por imagen que proporciona cortes transversales detallados de los órganos internos para planificar cirugías.', 5, 15),
	(14, 'Resonancia Magnética (RM)', 'Servicio de diagnóstico por imagen que utiliza campos magnéticos para crear imágenes detalladas de los órganos y tejidos internos.', 5, 10),
	(15, 'Monitoreo Cardíaco', 'Servicio de monitoreo continuo de la actividad cardíaca de los pacientes en estado crítico, como post-quirúrgicos o con afecciones graves.', 12, 20),
	(16, 'Oxigenoterapia', 'Servicio que proporciona oxígeno de manera terapéutica a pacientes que lo requieren debido a problemas respiratorios graves.', 15, 15),
	(17, 'Electroencefalograma (EEG)', 'Servicio para monitorear la actividad eléctrica del cerebro, utilizado en pacientes con trastornos neurológicos críticos.', 17, 10),
	(18, 'Radiología General', 'Servicio encargado de realizar radiografías para el diagnóstico de fracturas, enfermedades pulmonares, y otros trastornos.', 5, 50),
	(22, 'Mamografía', 'Servicio especializado en el diagnóstico temprano del cáncer de mama mediante imágenes radiográficas.', 5, 20),
	(23, 'Análisis de Sangre', 'Servicio que realiza análisis de sangre para diagnosticar una amplia variedad de condiciones médicas, desde infecciones hasta enfermedades crónicas.', 6, 120),
	(24, 'Análisis de Orina', 'Servicio para analizar muestras de orina y diagnosticar enfermedades del tracto urinario, riñones, entre otros.', 6, 100),
	(25, 'Pruebas de Biología Molecular', 'Servicio que realiza pruebas avanzadas para diagnosticar enfermedades infecciosas, genéticas y otras condiciones médicas mediante el análisis molecular.', 6, 15),
	(27, 'Biopsias Oncológicas', 'Servicio para realizar biopsias de tejidos sospechosos para el diagnóstico de cáncer.', 8, 10),
	(28, 'Radioterapia', 'Servicio especializado en la administración de radiación para el tratamiento de ciertos tipos de cáncer.', 8, 10),
	(29, 'Exámenes Neonatales', 'Servicio para realizar pruebas a los recién nacidos con el fin de detectar posibles problemas de salud, como cardiopatías, enfermedades metabólicas, entre otros.', 9, 25),
	(30, 'Ecografía Pediátrica', 'Servicio de diagnóstico por ultrasonido adaptado a niños, para el estudio de diversas condiciones pediátricas.', 9, 25),
	(31, 'Ecografía Ginecológica', 'Servicio de diagnóstico por imagen utilizado para el estudio de la salud reproductiva femenina, incluido el seguimiento del embarazo.', 10, 20),
	(32, 'Pruebas de Fertilidad', 'Servicio para realizar análisis y estudios relacionados con la fertilidad, tanto masculina como femenina.', 10, 15),
	(33, 'Dermatoscopia', 'Servicio que permite examinar la piel de manera más detallada, para detectar signos de cáncer o afecciones dérmicas.', 11, 20),
	(34, 'Pruebas de Alergia Dermatológica', 'Servicio que realiza pruebas para identificar reacciones alérgicas de la piel, como dermatitis alérgica, eccemas, entre otros.', 28, 15),
	(35, 'Laboratorio de Endocrinología', 'El Laboratorio de Endocrinología es un servicio especializado encargado del análisis de parámetros hormonales y metabólicos para el diagnóstico, seguimiento y control de enfermedades endocrinas.', 13, 30),
	(36, 'Laboratorio de Bacteriología', 'Es un examen microbiológico que busca detectar bacterias, hongos u otros microorganismos en la sangre. Se realiza cuando se sospecha de infecciones en la sangre (bacteriemia, septicemia).', 14, 25),
	(37, 'Área de Diagnóstico Funcional Cardiológico', 'Área destinada a la evaluación no invasiva del funcionamiento del sistema cardiovascular mediante estudios especializados. Estas evaluaciones permiten el diagnóstico, seguimiento y control de enfermedades cardíacas como arritmias, insuficiencia cardíaca, cardiopatías isquémicas e hipertensión arterial. El área cuenta con equipamiento especializado y personal capacitado para garantizar resultados confiables y atención segura al paciente.', 12, 20),
	(38, 'Laboratorio de Bioquímica Clínica', 'El Laboratorio de Bioquímica Clínica es un servicio especializado en el análisis de muestras biológicas (principalmente sangre, orina, líquido cefalorraquídeo, entre otros) con el objetivo de evaluar el funcionamiento de diferentes órganos y sistemas del cuerpo humano. Su función principal es apoyar el diagnóstico, seguimiento y prevención de enfermedades mediante pruebas químicas precisas y controladas.', 6, 50),
	(39, 'Laboratorio de Inmunología', 'El Laboratorio de Inmunología es un servicio especializado que se encarga del análisis y evaluación del sistema inmunológico mediante pruebas específicas que detectan y cuantifican componentes inmunitarios en muestras biológicas, principalmente sangre.', 6, 25),
	(40, 'Laboratorio de Banco de Sangre', 'El Laboratorio de Banco de Sangre es un servicio especializado que se encarga de la obtención, procesamiento, almacenamiento y distribución segura de sangre y sus componentes (glóbulos rojos, plasma, plaquetas) para transfusiones. Su objetivo principal es garantizar que la sangre transfundida sea compatible y segura para los pacientes que la requieren.', 30, 40),
	(41, 'Servicio de Ecocardiografía', 'El Servicio de Ecocardiografía es una unidad especializada dentro del Departamento de Cardiología que se dedica a la realización de estudios ecográficos del corazón mediante el uso de ultrasonido. Este servicio permite obtener imágenes en tiempo real de la estructura y función cardíaca sin necesidad de procedimientos invasivos ni radiación.', 12, 15),
	(42, 'Neumología', 'El servicio de diagnóstico en Neumología se centra en la identificación de enfermedades respiratorias a través de consultas clínicas, pruebas de función pulmonar, y estudios por imagen. Este servicio está diseñado para evaluar desde enfermedades agudas, como infecciones respiratorias, hasta trastornos respiratorios crónicos, como el asma y la EPOC.', 15, 20),
	(43, 'Laboratorio de Hormonas', 'El Laboratorio de Hormonas es una unidad especializada dentro del Departamento de Laboratorio Clínico de hospitales, clínicas o centros médicos, que se dedica a la realización de pruebas diagnósticas para medir los niveles de diversas hormonas en muestras biológicas, generalmente sangre. Las hormonas son mensajeros químicos que regulan una amplia variedad de funciones biológicas en el cuerpo, incluyendo el metabolismo, la reproducción, el crecimiento, y el bienestar general.', 6, 25),
	(44, 'Sala de Mamografía', 'Servicio especializado en el diagnóstico temprano del cáncer de mama mediante imágenes radiográficas.', 5, 20),
	(45, 'Anatomía Patológica', 'El Servicio de Anatomía Patológica es una unidad especializada dentro del sistema de salud que se dedica al estudio, diagnóstico y análisis de enfermedades a través del examen macroscópico y microscópico de tejidos, células y órganos. Este servicio es fundamental para el diagnóstico definitivo de diversas patologías, especialmente en el campo de la oncología, infecciones, enfermedades inflamatorias y degenerativas.', 20, 15),
	(46, 'Ginecología', 'El Servicio de Ginecología es una unidad clínica especializada en la atención integral de la salud del aparato reproductor femenino, desde la adolescencia hasta la edad avanzada. Su objetivo principal es prevenir, diagnosticar y tratar enfermedades ginecológicas, así como brindar atención quirúrgica y médica en los distintos trastornos que afectan a la mujer.', 10, 30),
	(47, 'Dermatología', 'El Servicio de Dermatología es la unidad especializada en el diagnóstico, tratamiento y prevención de las enfermedades que afectan la piel, el cabello, las uñas y las mucosas. Su objetivo es ofrecer una atención integral a pacientes de todas las edades, abordando tanto problemas médicos como estéticos relacionados con la salud cutánea.', 11, 20),
	(48, 'Neurología', 'El Servicio de Diagnóstico en Neurología es la unidad encargada de realizar, interpretar y apoyar con pruebas específicas el diagnóstico funcional y estructural de enfermedades del sistema nervioso central y periférico.\r\n\r\nSe apoya en técnicas neurofisiológicas, neuroimagenológicas y laboratoriales que permiten estudiar la actividad eléctrica, la conducción nerviosa, la estructura cerebral y otras funciones neurológicas.', 17, 15);
