INSERT INTO `hospital_personal_lugar` (`id`, `nombre`, `tipo`, `piso`, `sala`, `abreviacion`, `capacidad`, `descripcion`, `es_critico`, `activo`, `departamento_id`, `unidad_id`) VALUES
	(1, 'Unidad de Oftalmología', 'unidad_atenc', 0, NULL, 'UO', 200, 'La Unidad de Oftalmología es el área especializada en diagnóstico, tratamiento y seguimiento de enfermedades y trastornos del ojo y la visión.\r\nAtiende afecciones como problemas de refracción, cataratas, glaucoma, infecciones oculares y lesiones, realizando evaluaciones, procedimientos quirúrgicos y terapias médicas para mejorar o preservar la visión del paciente.', 0, 1, 27, NULL),
	(2, 'Unidad de Obstetricia y Atención al Parto', 'unidad_atenc', 1, NULL, 'UOAP', 200, 'La Unidad de Obstetricia y Atención al Parto es el área especializada en el cuidado de mujeres embarazadas, el seguimiento del embarazo y la atención del parto.\r\nBrinda control prenatal, manejo de complicaciones obstétricas y apoyo durante el trabajo de parto, asegurando la salud de la madre y del bebé durante todo el proceso.', 1, 1, 10, NULL),
	(3, 'Consultorio de Urgencias 1', 'cons', 0, 12, 'CONS-URG', 1, 'Consultorio de primera atención de emergencias.', 1, 1, 1, NULL),
	(4, 'Quirófano de Trauma 1', 'qui', 3, 300, 'QUI-TRA', 1, 'Quirófano para intervenciones urgentes por trauma.', 1, 1, 3, NULL),
	(5, 'Quirófano de Trauma 2', 'qui', 3, 301, 'QUI-TRA', 1, 'Quirófano preparado para cirugía de urgencia.', 1, 1, 3, NULL),
	(6, 'Habitación Medicina General 1', 'hab', 1, 149, 'HAB-MG', 5, 'La Habitación de Medicina General es el espacio destinado a pacientes hospitalizados que requieren atención médica general, pero no cuidados críticos.\r\nSe utiliza para reposo, tratamiento, monitoreo de signos vitales y seguimiento del estado de salud, permitiendo al personal médico brindar atención continua y control del paciente durante su estancia.', 0, 1, 2, 216),
	(7, 'Consultorio de Medicina General 1', 'cons', 1, 100, 'CONS-MG', 1, 'Consultorio para consultas generales.', 0, 1, 2, NULL),
	(8, 'Consultorio de Medicina General 2', 'cons', 1, 101, 'CONS-MG', 1, 'Consultorio destinado a chequeos médicos básicos.', 0, 1, 2, NULL),
	(9, 'Consultorio de Medicina General 3', 'cons', 1, 102, 'CONS-MG', 1, 'Consultorio de diagnóstico y tratamiento general.', 0, 1, 2, NULL),
	(10, 'Consultorio de Pediatría 1', 'cons', 2, 200, 'CONS-PED', 1, 'Consultorio especializado en atención pediátrica.', 0, 1, 9, NULL),
	(11, 'Consultorio de Pediatría 2', 'cons', 2, 201, 'CONS-PED', 1, 'Consultorio para seguimiento del crecimiento y vacunas.', 0, 1, 9, NULL),
	(12, 'Habitación Medicina General 2', 'hab', 1, 150, 'HAB-MG', 5, 'La Habitación de Medicina General es el espacio destinado a pacientes hospitalizados que requieren atención médica general, pero no cuidados críticos.\r\nSe utiliza para reposo, tratamiento, monitoreo de signos vitales y seguimiento del estado de salud, permitiendo al personal médico brindar atención continua y control del paciente durante su estancia.', 0, 1, 2, 216),
	(13, 'Consultorio de Ginecología 1', 'cons', 2, 203, 'CONS-GIN', 1, 'Consultorio de control ginecológico.', 0, 1, 10, NULL),
	(14, 'Consultorio de Obstetricia 1', 'cons', 2, 204, 'CONS-OBS', 1, 'Consultorio de control prenatal.', 0, 1, 10, NULL),
	(15, 'Sala de Partos 1', 'proc', 2, 205, 'SAL-PAR', 1, 'Sala destinada a la atención del parto.', 1, 1, 10, NULL),
	(16, 'Consultorio de Dermatología 1', 'cons', 1, 103, 'CONS-DER', 1, 'Consultorio para diagnóstico de enfermedades cutáneas.', 0, 1, 11, NULL),
	(17, 'Consultorio de Dermatología 2', 'cons', 1, 104, 'CONS-DER', 1, 'Consultorio para tratamientos dermatológicos.', 0, 1, 11, NULL),
	(18, 'Consultorio de Dermatología Estética', 'cons', 1, 105, 'CONS-DER', 1, 'Consultorio para tratamientos estéticos de la piel.', 0, 1, 11, NULL),
	(19, 'Quirófano de Cirugía General 1', 'qui', 3, 302, 'QUI-CG', 1, 'Quirófano para cirugías abdominales y generales.', 1, 1, 3, NULL),
	(20, 'Quirófano de Cirugía General 2', 'qui', 3, 303, 'QUI-CG', 1, 'Quirófano para operaciones de rutina.', 1, 1, 3, NULL),
	(21, 'Sala Preoperatoria Cirugía General', 'area_apoyo', 3, 304, 'PRE-CG', 2, 'Sala para preparación de pacientes quirúrgicos.', 1, 1, 3, NULL),
	(22, 'Quirófano Oncológico 1', 'qui', 3, 305, 'QUI-ONC', 1, 'Quirófano para resección de tumores.', 1, 1, 3, NULL),
	(23, 'Quirófano Oncológico 2', 'qui', 3, 306, 'QUI-ONC', 1, 'Quirófano para cirugía oncológica compleja.', 1, 1, 3, NULL),
	(24, 'Unidad de Ginecológia', 'unidad_atenc', 1, NULL, 'UG', 200, 'La Unidad de Ginecología es el área dedicada a la atención de la salud del sistema reproductor femenino en mujeres no embarazadas.\r\nSe encarga de diagnóstico, tratamiento y seguimiento de enfermedades ginecológicas, así como de prevención, control de la salud sexual y reproductiva de las pacientes.', 0, 1, 10, NULL),
	(25, 'Quirófano Vascular 1', 'qui', 3, 307, 'QUI-VAS', 1, 'Quirófano especializado en cirugía de vasos sanguíneos.', 1, 1, 3, NULL),
