	(27, 'Unidad de Cirugía Vascular y Endovascular', 'unidad_atenc', 2, NULL, 'UCVE', 200, 'La Unidad de Cirugía Vascular y Endovascular es el área especializada en el diagnóstico y tratamiento quirúrgico de enfermedades de los vasos sanguíneos (arterias y venas), mediante cirugía abierta y procedimientos endovasculares mínimamente invasivos.\r\nTrata afecciones como aneurismas, obstrucciones arteriales, insuficiencia venosa y trombosis, con el objetivo de restablecer la circulación y prevenir complicaciones graves.', 1, 1, 3, NULL),
