	(55, 'Unidad de Cirugía Dermatológica', 'unidad_atenc', 2, NULL, 'UCD', 200, 'La Unidad de Cirugía Dermatológica es el área especializada en realizar procedimientos quirúrgicos en la piel para tratar lesiones, tumores, lunares o enfermedades dermatológicas que requieren intervención.\r\nSu objetivo es eliminar o corregir afecciones cutáneas, combinando precisión quirúrgica y cuidado estético para favorecer la salud y apariencia de la piel.', 0, 1, 11, NULL),
	(56, 'Habitación Medicina General 4', 'hab', 2, 218, 'HAB-MG', 5, 'La Habitación de Medicina General es el espacio destinado a pacientes hospitalizados que requieren atención médica general, pero no cuidados críticos.\r\nSe utiliza para reposo, tratamiento, monitoreo de signos vitales y seguimiento del estado de salud, permitiendo al personal médico brindar atención continua y control del paciente durante su estancia.', 0, 1, 2, 216),
	(57, 'Unidad de Anatomía Patológica', 'unidad_atenc', 2, NULL, 'UAP', 200, 'La Unidad de Anatomía Patológica es el área encargada del estudio de tejidos, órganos y muestras biológicas para diagnosticar enfermedades, incluyendo cáncer, infecciones y alteraciones celulares.\r\nSe realiza mediante exámenes microscópicos y pruebas especiales, apoyando al equipo médico en la toma de decisiones para tratamiento y seguimiento del paciente.', 0, 1, 20, NULL),
