	(93, 'Unidad de Ortopedia y Traumatología', 'unidad_atenc', 4, NULL, 'UOT', 200, 'La Unidad de Ortopedia y Traumatología es el área especializada en diagnóstico, tratamiento y recuperación de lesiones y enfermedades del sistema musculoesquelético, incluyendo huesos, articulaciones, músculos y ligamentos.\r\nAtiende fracturas, luxaciones, lesiones deportivas, deformidades y realiza procedimientos quirúrgicos, inmovilización y rehabilitación, con el objetivo de restaurar la función y movilidad del paciente.', 0, 1, 32, NULL),
