	(99, 'Unidad de Cirugía Torácica', 'unidad_atenc', 4, NULL, 'UCT', 200, 'La Unidad de Cirugía Torácica es el área especializada en diagnóstico y tratamiento quirúrgico de enfermedades del tórax, incluyendo pulmones, tráquea, esófago, pleura y mediastino.\r\nRealiza procedimientos quirúrgicos para tratar tumores, malformaciones, traumatismos o enfermedades respiratorias graves, con el objetivo de restaurar la función torácica y mejorar la salud respiratoria del paciente.', 0, 1, 3, NULL),
