	(102, 'Unidad de Dermatología Estética y Procedimientos Cosméticos', 'unidad_atenc', 2, NULL, 'UDEPC', 200, 'La Unidad de Dermatología Estética y Procedimientos Cosméticos es el área especializada en tratamientos de la piel con fines estéticos o de mejora de la apariencia, incluyendo arrugas, cicatrices, manchas y rejuvenecimiento cutáneo.\r\nSe realizan procedimientos no quirúrgicos y mínimamente invasivos, como rellenos, láser o peelings, buscando mejorar la estética y la salud de la piel de manera segura.', 0, 1, 11, NULL),
