	(108, 'Unidad de Anestesiología y Recuperación Postanestésica', 'unidad_atenc', 4, NULL, 'UARP', 200, 'La Unidad de Anestesiología y Recuperación Postanestésica es el área encargada de administrar anestesia segura antes y durante cirugías y de vigilar al paciente en la etapa inmediata de recuperación.\r\nSu función principal es garantizar que los pacientes despierten de manera segura, controlar el dolor postoperatorio y prevenir complicaciones tras procedimientos quirúrgicos.', 0, 1, 19, NULL),
	(109, 'Habitación Medicina General 3', 'hab', 1, 138, 'HAB-MG', 5, 'La Habitación de Medicina General es el espacio destinado a pacientes hospitalizados que requieren atención médica general, pero no cuidados críticos.\r\nSe utiliza para reposo, tratamiento, monitoreo de signos vitales y seguimiento del estado de salud, permitiendo al personal médico brindar atención continua y control del paciente durante su estancia.', 0, 1, 2, 216),
	(110, 'Habitación Pediatría 1', 'hab', 1, 139, 'HAB-PED', 5, 'Espacio destinado a niños y adolescentes hospitalizados que requieren atención médica y monitoreo, pero no cuidados críticos intensivos.\r\nBrinda un entorno adaptado a pacientes pediátricos, donde se realizan controles médicos, administración de tratamientos y seguimiento del desarrollo y recuperación durante la estancia hospitalaria.', 0, 1, 9, 191),
	(111, 'Habitación Pediatría 2', 'hab', 1, 140, 'HAB-PED', 5, 'Espacio destinado a niños y adolescentes hospitalizados que requieren atención médica y monitoreo, pero no cuidados críticos intensivos.\r\nBrinda un entorno adaptado a pacientes pediátricos, donde se realizan controles médicos, administración de tratamientos y seguimiento del desarrollo y recuperación durante la estancia hospitalaria.', 0, 1, 9, 191),
	(112, 'Unidad de Neurología', 'unidad_atenc', 1, NULL, 'UN', 200, 'La Unidad de Neurología es el área especializada en diagnóstico, tratamiento y seguimiento de enfermedades del sistema nervioso, incluyendo cerebro, médula espinal, nervios y músculos.\r\nAtiende afecciones como accidentes cerebrovasculares, epilepsia, migrañas, trastornos neurodegenerativos y neuropatías, realizando evaluaciones clínicas, estudios de neuroimagen y terapias médicas, con el objetivo de mejorar la función neurológica y la calidad de vida del paciente.', 0, 1, 17, NULL),
	(113, 'Unidad de Hospitalización Oncológica', 'unidad_atenc', 1, NULL, 'UHO', 200, 'La Unidad de Hospitalización Oncológica es el área destinada a la atención integral de pacientes con cáncer que requieren internación para tratamiento, control de síntomas o manejo de complicaciones.\r\nEn esta unidad se administran terapias oncológicas, se realiza seguimiento médico continuo y se brinda apoyo multidisciplinario para mejorar la calidad de vida del paciente durante su estancia hospitalaria.', 0, 1, 8, NULL),
