	(182, 'Consultorio de Ortopedia 2', 'cons', 1, 127, 'CONST-ORT', 1, 'Espacio clínico dedicado a la evaluación, diagnóstico, tratamiento y seguimiento de pacientes con problemas del sistema musculoesquelético, que incluye huesos, articulaciones, músculos, tendones y ligamentos.', 0, 1, 3, NULL),
	(183, 'Oficina de Jefatura de Enfermería de Urgencias', 'area_apoyo', 4, 431, 'OFI-JEF-ENF-URG', 1, 'La Oficina de Jefatura de Enfermería de Urgencias es el espacio administrativo y operativo desde donde se planifica, coordina y supervisa la atención de enfermería en el departamento de Urgencias.', 0, 1, 1, 184),
	(184, 'Unidad de Emergencias Generales', 'unidad_atenc', 1, NULL, 'UEG', 200, 'La Unidad de Emergencias Generales es el área del hospital destinada a la atención inmediata de pacientes que presentan situaciones agudas, urgentes o potencialmente graves, sin distinción de edad o tipo de enfermedad. Su función principal es brindar evaluación rápida, diagnóstico inicial y tratamiento estabilizador antes de decidir si el paciente requiere ingreso hospitalario, traslado a una unidad especializada o manejo ambulatorio.', 0, 1, 1, NULL),
	(185, 'Unidad de Emergencias Pediátricas', 'unidad_atenc', 1, NULL, 'UEP', 200, 'La Unidad de Emergencias Pediátricas es el servicio especializado del hospital encargado de la atención inmediata de niños y adolescentes que presentan enfermedades agudas, lesiones o situaciones que ponen en riesgo su salud o su vida. Su principal objetivo es ofrecer una evaluación rápida, segura y humanizada, adaptada a las necesidades propias de la población infantil.', 0, 1, 1, NULL),
	(186, 'Habitación Pediatría 3', 'hab', 1, 128, 'HAB-PED', 5, 'Espacio destinado a niños y adolescentes hospitalizados que requieren atención médica y monitoreo, pero no cuidados críticos intensivos.\r\nBrinda un entorno adaptado a pacientes pediátricos, donde se realizan controles médicos, administración de tratamientos y seguimiento del desarrollo y recuperación durante la estancia hospitalaria.', 0, 1, 9, 191),
	(187, 'Unidad de Cirugía General', 'unidad_atenc', 1, NULL, 'UCG', 200, 'La Unidad de Cirugía General es el servicio hospitalario encargado del diagnóstico, tratamiento quirúrgico y seguimiento de pacientes con patologías que requieren intervención en los principales órganos y sistemas del cuerpo humano, como el aparato digestivo, endocrino, mamario, abdominal y partes blandas.', 0, 1, 3, NULL),
	(188, 'Unidad de Cirugía Ortopédica', 'unidad_atenc', 1, NULL, 'UCO', 200, 'La Unidad de Cirugía Ortopédica es el servicio hospitalario especializado en la prevención, diagnóstico, tratamiento quirúrgico y rehabilitación de enfermedades, lesiones y deformidades del sistema musculoesquelético, que incluye huesos, articulaciones, músculos, tendones y ligamentos.', 0, 1, 3, NULL),
	(189, 'Unidad de Cirugía Plástica, Reconstructiva y Estética', 'unidad_atenc', 1, NULL, 'UCPRE', 200, 'La Unidad de Cirugía Plástica, Reconstructiva y Estética es el área especializada en restaurar, mejorar o modificar la forma y función del cuerpo mediante cirugía.\r\nRealiza procedimientos reconstructivos tras accidentes, malformaciones o cirugías previas, y procedimientos estéticos para mejorar la apariencia, combinando habilidad quirúrgica y cuidado estético para optimizar la salud y bienestar del paciente.', 0, 1, 3, NULL),
	(190, 'Unidad de Cuidados Intensivos', 'unidad_atenc', 1, NULL, 'UCI', 200, 'La Unidad de Cuidados Intensivos es el área del hospital destinada a la atención de pacientes en estado crítico que requieren vigilancia continua, soporte vital y tratamientos especializados.\r\nCuenta con personal altamente capacitado y tecnología avanzada para el monitoreo permanente, manejo de fallas orgánicas y estabilización de pacientes con riesgo vital.\r\n\r\nSi necesitas, puedo ayudarte a cerrar la lista completa con un forma', 1, 1, 4, NULL),
	(191, 'Unidad de Pediatría', 'unidad_atenc', 1, NULL, 'UP', 200, 'La Unidad de Pediatría es el área del hospital dedicada a la atención médica de niños y adolescentes, desde recién nacidos hasta la adolescencia.\r\nSe encarga del diagnóstico, tratamiento y seguimiento de enfermedades infantiles, así como de la prevención y control del crecimiento y desarrollo, brindando una atención adaptada a las necesidades físicas y emocionales del paciente pediátrico.', 0, 1, 9, NULL),
	(192, 'Unidad de Neonatología y Cuidados Intensivos Neonatales', 'unidad_atenc', 1, NULL, 'UNCIN', 200, 'La Unidad de Neonatología y Cuidados Intensivos Neonatales es el área especializada en atender a recién nacidos, especialmente aquellos prematuros o con condiciones médicas críticas.\r\nSe encarga de monitoreo constante, soporte vital, tratamiento de enfermedades congénitas o adquiridas y cuidado especializado, con el objetivo de garantizar la supervivencia y el desarrollo saludable del recién nacido.', 0, 1, 9, NULL),
	(193, 'Unidad de Radiología Intervencionista y Terapéutica', 'unidad_atenc', 1, NULL, 'URIT', 200, 'La Unidad de Radiología Intervencionista y Terapéutica es el área especializada en diagnóstico y tratamiento de enfermedades mediante procedimientos mínimamente invasivos guiados por imágenes médicas (rayos X, ecografía, tomografía, etc.).\r\nSe realizan biopsias, drenajes, colocación de catéteres y tratamientos vasculares o tumorales, buscando reducir riesgos y tiempos de recuperación en comparación con la cirugía tradicional.', 0, 1, 5, NULL),
	(194, 'Unidad de Cuidados Paliativos y Atención al Dolor', 'unidad_atenc', 1, NULL, 'UCPAD', 200, 'La Unidad de Cuidados Paliativos y Atención al Dolor es el área especializada en brindar alivio del dolor y apoyo integral a pacientes con enfermedades graves o terminales.\r\nSe enfoca en control de síntomas, manejo del dolor, apoyo emocional y acompañamiento tanto al paciente como a su familia, con el objetivo de mejorar la calidad de vida y el bienestar durante la enfermedad.', 0, 1, 25, NULL),
	(195, 'Unidad de Dermatología Clínica', 'unidad_atenc', 1, NULL, 'UDC', 200, 'La Unidad de Dermatología Clínica es el área encargada del diagnóstico, tratamiento y seguimiento de enfermedades de la piel, cabello y uñas.\r\nAtiende afecciones como infecciones cutáneas, dermatitis, acné, enfermedades autoinmunes de la piel y lesiones sospechosas, además de realizar evaluaciones clínicas y procedimientos dermatológicos básicos.', 0, 1, 11, NULL),
	(196, 'Unidad de Cardiología Clínica y Unidad Coronaria', 'unidad_atenc', 1, NULL, 'UCC', 200, 'La Unidad de Cardiología Clínica y Unidad Coronaria es el área dedicada al diagnóstico, tratamiento y seguimiento de enfermedades del corazón y vasos sanguíneos.', 0, 1, 12, NULL),
	(197, 'Unidad de Endocrinología y Metabolismo', 'unidad_atenc', 1, NULL, 'UEM', 200, 'La Unidad de Endocrinología y Metabolismo es el área especializada en diagnóstico, tratamiento y seguimiento de enfermedades hormonales y metabólicas, como diabetes, problemas de tiroides, obesidad y trastornos del crecimiento.\r\nBrinda atención personalizada y multidisciplinaria, realizando estudios hormonales, seguimiento de tratamientos y educación al paciente para mantener un equilibrio metabólico y hormonal saludable.', 0, 1, 13, NULL),
	(198, 'Unidad de Bacteriología Clínica', 'unidad_atenc', 1, NULL, 'UBC', 200, '', 0, 1, 14, NULL),
	(199, 'Unidad de Neumología y Enfermedades Respiratorias', 'unidad_atenc', 1, NULL, 'UNER', 200, 'La Unidad de Neumología y Enfermedades Respiratorias es el área especializada en el diagnóstico, tratamiento y seguimiento de enfermedades del sistema respiratorio, como asma, EPOC, infecciones respiratorias y apnea del sueño.\r\nBrinda atención tanto ambulatoria como hospitalaria, incluyendo pruebas de función pulmonar, broncoscopias y manejo de pacientes críticos respiratorios, con el objetivo de mejorar la función pulmonar y la calidad de vida del paciente.', 0, 1, 15, NULL),
	(200, 'Habitación de Oncología Médica 1', 'hab', 1, 129, 'HAB-ONC', 5, 'La Habitación de Oncología Médica es el espacio destinado a pacientes con cáncer que requieren hospitalización para tratamiento, control de síntomas o manejo de efectos secundarios.\r\nSe brinda atención médica continua, administración de quimioterapia u otros tratamientos oncológicos, así como apoyo multidisciplinario para mejorar la calidad de vida del paciente durante su estancia.', 0, 1, 8, 113),
	(201, 'Habitación de Oncología Médica 2', 'hab', 1, 130, 'HAB-ONC', 4, 'La Habitación de Oncología Médica es el espacio destinado a pacientes con cáncer que requieren hospitalización para tratamiento, control de síntomas o manejo de efectos secundarios.\r\nSe brinda atención médica continua, administración de quimioterapia u otros tratamientos oncológicos, así como apoyo multidisciplinario para mejorar la calidad de vida del paciente durante su estancia.', 0, 1, 8, 113),
	(202, 'Habitación de Oncología Ginecológica 1', 'hab', 1, 131, 'HAB-ONC-GIN', 5, 'La Habitación de Oncología Ginecológica es el espacio destinado a pacientes con cáncer del aparato reproductor femenino que requieren hospitalización para tratamiento, seguimiento o manejo de complicaciones.\r\nSe brinda atención médica especializada, administración de terapias y apoyo multidisciplinario, asegurando confort y cuidado integral durante la estancia hospitalaria.', 0, 1, 8, 113),
	(203, 'Habitación de Oncología Ginecológica 2', 'hab', 1, 132, 'HAB-ONC-GIN', 5, 'La Habitación de Oncología Ginecológica es el espacio destinado a pacientes con cáncer del aparato reproductor femenino que requieren hospitalización para tratamiento, seguimiento o manejo de complicaciones.\r\nSe brinda atención médica especializada, administración de terapias y apoyo multidisciplinario, asegurando confort y cuidado integral durante la estancia hospitalaria.', 0, 1, 8, 113),
	(204, 'Habitación Obstetricia 1', 'hab', 1, 133, 'HAB-OBS', 5, 'La Habitación Obstetricia es el espacio destinado a mujeres embarazadas que requieren seguimiento, control o preparación para el parto.\r\nSe brinda atención médica continua, monitoreo de signos vitales y apoyo al bienestar de la madre y el bebé, asegurando un entorno seguro y confortable durante la hospitalización.', 0, 1, 10, 2),
	(205, 'Habitación Obstetricia 2', 'hab', 1, 134, 'HAB-OBS', 5, 'La Habitación Obstetricia es el espacio destinado a mujeres embarazadas que requieren seguimiento, control o preparación para el parto.\r\nSe brinda atención médica continua, monitoreo de signos vitales y apoyo al bienestar de la madre y el bebé, asegurando un entorno seguro y confortable durante la hospitalización.', 0, 1, 10, 2),
	(206, 'Habitación Obstetricia 3', 'hab', 2, 246, 'HAB-OBS', 5, 'La Habitación Obstetricia es el espacio destinado a mujeres embarazadas que requieren seguimiento, control o preparación para el parto.\r\nSe brinda atención médica continua, monitoreo de signos vitales y apoyo al bienestar de la madre y el bebé, asegurando un entorno seguro y confortable durante la hospitalización.', 0, 1, 10, 2),
	(207, 'Habitación Ginecología 1', 'hab', 1, 141, 'HAB-GIN', 5, 'La Habitación Ginecología es el espacio destinado a pacientes femeninas que requieren hospitalización para atención médica del sistema reproductor, fuera del embarazo.\r\nSe brinda diagnóstico, tratamiento, monitoreo y seguimiento de enfermedades ginecológicas, en un entorno seguro y cómodo durante su estancia hospitalaria.', 0, 1, 10, 24),
	(208, 'Habitación Ginecología 2', 'hab', 1, 142, 'HAB-GIN', 5, 'La Habitación Ginecología es el espacio destinado a pacientes femeninas que requieren hospitalización para atención médica del sistema reproductor, fuera del embarazo.\r\nSe brinda diagnóstico, tratamiento, monitoreo y seguimiento de enfermedades ginecológicas, en un entorno seguro y cómodo durante su estancia hospitalaria.', 0, 1, 10, 24),
	(209, 'Habitación de Ginecología 3', 'hab', 1, 143, 'HAB-GIN', 5, 'La Habitación Ginecología es el espacio destinado a pacientes femeninas que requieren hospitalización para atención médica del sistema reproductor, fuera del embarazo.\r\nSe brinda diagnóstico, tratamiento, monitoreo y seguimiento de enfermedades ginecológicas, en un entorno seguro y cómodo durante su estancia hospitalaria.', 0, 1, 10, 24),
	(210, 'Habitación Cardiología 1', 'hab', 1, 144, 'HAB-CAR', 5, 'La Habitación Cardiología es el espacio destinado a pacientes con enfermedades del corazón y sistema cardiovascular que requieren hospitalización, pero no cuidados intensivos.\r\nSe brinda monitoreo de signos vitales, administración de tratamientos y seguimiento de la evolución cardíaca, asegurando un entorno seguro y confortable para la recuperación del paciente.', 0, 1, 12, 196),
	(211, 'Habitación de Cardiología 2', 'hab', 1, 145, 'HAB-CAR', 5, 'La Habitación Cardiología es el espacio destinado a pacientes con enfermedades del corazón y sistema cardiovascular que requieren hospitalización, pero no cuidados intensivos.\r\nSe brinda monitoreo de signos vitales, administración de tratamientos y seguimiento de la evolución cardíaca, asegurando un entorno seguro y confortable para la recuperación del paciente.', 0, 1, 12, 196),
	(212, 'Habitación de Cardiología 3', 'hab', 1, 146, 'HAB-CAR', 5, 'La Habitación Cardiología es el espacio destinado a pacientes con enfermedades del corazón y sistema cardiovascular que requieren hospitalización, pero no cuidados intensivos.\r\nSe brinda monitoreo de signos vitales, administración de tratamientos y seguimiento de la evolución cardíaca, asegurando un entorno seguro y confortable para la recuperación del paciente.', 0, 1, 12, 196),
	(213, 'Habitación Neumología 1', 'hab', 1, 147, 'HAB-NEU', 5, 'La Habitación Neumología es el espacio destinado a pacientes con enfermedades del sistema respiratorio, como asma, EPOC o infecciones respiratorias, que requieren hospitalización.\r\nSe brinda monitoreo de la función pulmonar, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 15, 199),
	(214, 'Habitación de Neumología 2', 'hab', 1, 148, 'HAB-NEU', 5, 'La Habitación Neumología es el espacio destinado a pacientes con enfermedades del sistema respiratorio, como asma, EPOC o infecciones respiratorias, que requieren hospitalización.\r\nSe brinda monitoreo de la función pulmonar, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 15, 199),
	(215, 'Oficina de Tecnologías de la Información (TI)', 'area_apoyo', 4, 432, 'OFI-TI', 10, 'La Oficina de Tecnologías de la Información (TI) del hospital es el área encargada de planificar, implementar, mantener y asegurar los recursos tecnológicos que soportan la atención médica y la gestión hospitalaria. Su misión es garantizar que los sistemas y herramientas digitales contribuyan a la eficiencia, seguridad y calidad en la prestación de servicios de salud.', 0, 1, 29, NULL),
	(216, 'Unidad de Medicina General y Hospitalización', 'unidad_atenc', 1, NULL, 'UMGH', 200, 'La Unidad de Medicina General y Hospitalización es el área del hospital encargada de la atención integral de pacientes adultos que requieren evaluación médica, tratamiento y permanencia en hospitalización, pero que no necesitan cuidados especializados intensivos.\r\nAquí se manejan enfermedades comunes, seguimiento de tratamientos, control de signos vitales y apoyo en la recuperación del paciente hasta su alta médica.', 0, 1, 2, NULL),
	(217, 'Unidad de Otorrinolaringología', 'unidad_atenc', 2, NULL, 'UORL', 200, 'La Unidad de Otorrinolaringología es el área especializada en diagnóstico y tratamiento de enfermedades de oído, nariz, garganta, cabeza y cuello.\r\nAtiende afecciones como infecciones, trastornos de audición, problemas de equilibrio, sinusitis, ronquidos, y realiza procedimientos médicos y quirúrgicos para mejorar la función y salud de estas áreas.', 0, 1, 26, NULL),
	(218, 'Unidad de Urología', 'unidad_atenc', 2, NULL, 'UU', 200, 'La Unidad de Urología es el área especializada en el diagnóstico, tratamiento y seguimiento de enfermedades del sistema urinario y del aparato reproductor masculino.\r\nAtiende afecciones como cálculos renales, infecciones urinarias, problemas de próstata, incontinencia y realiza procedimientos médicos y quirúrgicos para restaurar la función urinaria y reproductiva.', 0, 1, 31, NULL),
	(219, 'Unidad de Reumatología y Enfermedades Autoinmunes', 'unidad_atenc', 1, NULL, 'UREA', 200, 'La Unidad de Reumatología y Enfermedades Autoinmunes es el área especializada en diagnóstico, tratamiento y seguimiento de enfermedades que afectan articulaciones, huesos y tejidos conectivos, así como trastornos autoinmunes como lupus, artritis reumatoide o esclerosis múltiple.\r\nSe encarga de controlar inflamación, dolor y daño progresivo, combinando tratamientos médicos, terapias y seguimiento multidisciplinario para mejorar la calidad de vida del paciente.', 0, 1, 23, NULL),
	(220, 'Unidad de Gastroenterología y Endoscopía Digestiva', 'unidad_atenc', 1, NULL, 'UGED', 200, 'La Unidad de Gastroenterología y Endoscopía Digestiva es el área especializada en diagnóstico y tratamiento de enfermedades del aparato digestivo, incluyendo esófago, estómago, intestinos, hígado y páncreas.\r\nRealiza evaluaciones clínicas, estudios endoscópicos y procedimientos terapéuticos para tratar afecciones como gastritis, colitis, úlceras, pólipos y enfermedades hepáticas, con el objetivo de mantener la salud digestiva y prevenir complicaciones.', 0, 1, 22, NULL),
	(221, 'Habitación Neumología 3', 'hab', 1, 151, 'HAB-NEU', 5, 'La Habitación Neumología es el espacio destinado a pacientes con enfermedades del sistema respiratorio, como asma, EPOC o infecciones respiratorias, que requieren hospitalización.\r\nSe brinda monitoreo de la función pulmonar, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 15, 199),
	(222, 'Habitación Neumología 4', 'hab', 1, 152, 'HAB-NEU', 5, 'La Habitación Neumología es el espacio destinado a pacientes con enfermedades del sistema respiratorio, como asma, EPOC o infecciones respiratorias, que requieren hospitalización.\r\nSe brinda monitoreo de la función pulmonar, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 15, 199),
	(223, 'Habitación Endocrinología 1', 'hab', 1, 153, 'HAB-ENDO', 5, 'La Habitación Endocrinología es el espacio destinado a pacientes con enfermedades hormonales o metabólicas, como diabetes, problemas de tiroides u otras alteraciones endocrinas, que requieren hospitalización.\r\nSe brinda monitoreo de signos vitales, administración de tratamientos hormonales y seguimiento clínico, asegurando un entorno seguro y adecuado para la recuperación y control de la enfermedad.', 0, 1, 13, 197),
	(224, 'Habitación Endocrinología 2', 'hab', 1, 154, 'HAB-ENDO', 5, 'La Habitación Endocrinología es el espacio destinado a pacientes con enfermedades hormonales o metabólicas, como diabetes, problemas de tiroides u otras alteraciones endocrinas, que requieren hospitalización.\r\nSe brinda monitoreo de signos vitales, administración de tratamientos hormonales y seguimiento clínico, asegurando un entorno seguro y adecuado para la recuperación y control de la enfermedad.', 0, 1, 13, 197),
	(225, 'Habitación Reumatología 1', 'hab', 1, 155, 'HAB-REU', 5, 'La Habitación Reumatología es el espacio destinado a pacientes con enfermedades articulares, musculares o autoinmunes, como artritis, lupus o esclerosis múltiple, que requieren hospitalización.\r\nSe brinda monitoreo de síntomas, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y cómodo para controlar la inflamación, el dolor y favorecer la recuperación del paciente.', 0, 1, 23, 219),
	(226, 'Habitación Reumatología 2', 'hab', 1, 156, 'HAB-REU', 5, 'La Habitación Reumatología es el espacio destinado a pacientes con enfermedades articulares, musculares o autoinmunes, como artritis, lupus o esclerosis múltiple, que requieren hospitalización.\r\nSe brinda monitoreo de síntomas, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y cómodo para controlar la inflamación, el dolor y favorecer la recuperación del paciente.', 0, 1, 23, 219),
	(227, 'Habitación Gastroenterología 1', 'hab', 1, 157, 'HAB-GAS', 5, 'La Habitación Gastroenterología es el espacio destinado a pacientes con enfermedades del aparato digestivo, como gastritis, colitis, úlceras o enfermedades hepáticas, que requieren hospitalización.\r\nSe brinda monitoreo clínico, administración de tratamientos y procedimientos diagnósticos, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 22, 220),
	(228, 'Habitación Gastroenterología 2', 'hab', 1, 158, 'HAB-GAS', 5, 'La Habitación Gastroenterología es el espacio destinado a pacientes con enfermedades del aparato digestivo, como gastritis, colitis, úlceras o enfermedades hepáticas, que requieren hospitalización.\r\nSe brinda monitoreo clínico, administración de tratamientos y procedimientos diagnósticos, asegurando un entorno seguro y confortable durante la recuperación del paciente.', 0, 1, 22, 220),
	(229, 'Habitación Neurología 1', 'hab', 1, 159, 'HAB-NEUR', 5, 'La Habitación Neurología es el espacio destinado a pacientes con enfermedades del sistema nervioso, como accidentes cerebrovasculares, epilepsia o neuropatías, que requieren hospitalización.\r\nSe brinda monitoreo de signos neurológicos, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y adecuado para favorecer la recuperación y mantener la función neurológica del paciente.', 0, 1, 17, 112),
	(230, 'Habitación Neurología 2', 'hab', 1, 160, 'HAB-NEUR', 5, 'La Habitación Neurología es el espacio destinado a pacientes con enfermedades del sistema nervioso, como accidentes cerebrovasculares, epilepsia o neuropatías, que requieren hospitalización.\r\nSe brinda monitoreo de signos neurológicos, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y adecuado para favorecer la recuperación y mantener la función neurológica del paciente.', 0, 1, 17, 112),
	(231, 'Habitación Neurología 3', 'hab', 1, 161, 'HAB-NEUR', 5, 'La Habitación Neurología es el espacio destinado a pacientes con enfermedades del sistema nervioso, como accidentes cerebrovasculares, epilepsia o neuropatías, que requieren hospitalización.\r\nSe brinda monitoreo de signos neurológicos, administración de tratamientos y seguimiento clínico, asegurando un entorno seguro y adecuado para favorecer la recuperación y mantener la función neurológica del paciente.', 0, 1, 17, 112),
	(232, 'Habitación Cuidados Paliativos 1', 'hab', 1, 162, 'HAB-CP', 5, 'La Habitación de Cuidados Paliativos es el espacio destinado a pacientes con enfermedades graves o terminales que requieren alivio del dolor, control de síntomas y apoyo integral.\r\nSe brinda atención médica continua, acompañamiento emocional y confort, asegurando un entorno seguro y humano que mejore la calidad de vida del paciente y su familia durante la estancia.', 0, 1, 25, 194),
	(233, 'Habitación Cuidados Paliativos 2', 'hab', 1, 163, 'HAB-CP', 5, 'La Habitación de Cuidados Paliativos es el espacio destinado a pacientes con enfermedades graves o terminales que requieren alivio del dolor, control de síntomas y apoyo integral.\r\nSe brinda atención médica continua, acompañamiento emocional y confort, asegurando un entorno seguro y humano que mejore la calidad de vida del paciente y su familia durante la estancia.', 0, 1, 25, 194),
	(234, 'Habitación Cuidados Paliativos 3', 'hab', 1, 164, 'HAB-CP', 5, 'La Habitación de Cuidados Paliativos es el espacio destinado a pacientes con enfermedades graves o terminales que requieren alivio del dolor, control de síntomas y apoyo integral.\r\nSe brinda atención médica continua, acompañamiento emocional y confort, asegurando un entorno seguro y humano que mejore la calidad de vida del paciente y su familia durante la estancia.', 0, 1, 25, 194),
	(235, 'Sala PACU General 1', 'hab', 1, 165, 'HAB-PACU', 5, 'La Sala PACU General (Unidad de Recuperación Postanestésica) es el espacio destinado a pacientes que salen de cirugía o procedimientos con anestesia general.\r\nSe brinda monitoreo continuo de signos vitales, control del dolor y atención inmediata ante cualquier complicación postoperatoria, asegurando que el paciente recupere estabilidad antes de ser trasladado a su habitación correspondiente.', 0, 1, 3, 187),
	(236, 'Sala PACU General 2', 'hab', 1, 166, 'HAB-PACU', 5, 'La Sala PACU General (Unidad de Recuperación Postanestésica) es el espacio destinado a pacientes que salen de cirugía o procedimientos con anestesia general.\r\nSe brinda monitoreo continuo de signos vitales, control del dolor y atención inmediata ante cualquier complicación postoperatoria, asegurando que el paciente recupere estabilidad antes de ser trasladado a su habitación correspondiente.', 0, 1, 3, 187),
