INSERT INTO `hospital_personal_consultas` (`id`, `diagnostico`, `tratamiento`, `observaciones`, `fecha`, `turno_id`) VALUES
	(1, 'Síndrome gripal leve.', 'Reposo relativo, buena hidratación y medicación sintomática según indicación médica.', 'El paciente refiere malestar general, dolor de cabeza y cansancio.\nSe recomienda control evolutivo y seguimiento según resultados de estudios solicitados.', '2025-10-25 20:38:25.300033', 3);
INSERT INTO `hospital_personal_ordenestudio` (`id`, `motivo_estudio`, `indicaciones`, `fecha_solicitud`, `estado`, `consulta_id`, `solicitado_por_id`, `tipo_estudio_id`, `paciente_id`, `fecha_vencimiento`) VALUES
	(1, 'Para descartar complicaciones, valorar el estado general del paciente y confirmar la ausencia de alteraciones asociadas al cuadro de síndrome gripal leve, considerando el malestar general, cefalea y cansancio referidos.', 'No requiere ayuno, puede realizarse en cualquier horario, se recomienda mantener una adecuada hidratación, evitar actividad física intensa al menos 12 horas antes de la extracción y avisar al personal de laboratorio si se encuentra tomando medicación o presenta fiebre el día del estudio.', '2025-10-25 20:38:25.307893', 'programado', 1, 2, 33, 1, '2025-12-24 20:18:57.000000'),
	(2, 'Para descartar complicaciones, valorar el estado general del paciente y confirmar la ausencia de alteraciones asociadas al cuadro de síndrome gripal leve, considerando el malestar general, cefalea y cansancio referidos.', 'Debe realizarse con ayuno de 8 a 12 horas, permitiéndose únicamente la ingesta de agua, evitando consumo de alcohol, bebidas azucaradas, chicles y ejercicio físico intenso previo, y concurriendo preferentemente por la mañana para la extracción.', '2025-10-26 23:16:12.641671', 'vencida', 1, 2, 36, 1, '2025-12-17 20:20:48.000000');
