INSERT INTO `hospital_personal_observacionesmedico` (`id`, `evolucion_clinica`, `indicaciones`, `fecha_y_horario`, `asignacion_medico_id`, `diagnostico`, `motivo`) VALUES
	(1, 'Durante las primeras horas de observación, el paciente refiere disminución parcial del dolor posterior a la administración de analgesia intravenosa, aunque persiste dolor moderado a la palpación en fosa ilíaca derecha y defensa muscular leve. Signos vitales estables, sin deterioro hemodinámico.\r\nLaboratorios muestran leucocitosis de 14,500/mm³ con desviación izquierda.\r\nSe decidió manejo inicial con hidratación IV, analgésicos y antibióticos profilácticos mientras se prepara para intervención quirúrgica programada.\r\nEl paciente permanece alerta, orientado y colaborador.', 'Mantener acceso venoso periférico funcional.\r\nAdministrar hidratación IV según indicación médica.\r\nAdministrar analgesia y antibióticos prescritos, registrando respuesta o efectos adversos.\r\nVigilar dolor abdominal, características y cambios en intensidad.\r\nMantener al paciente en ayuno absoluto (NPO) previo a cirugía.\r\nReportar de inmediato cualquier signo de deterioro: fiebre persistente, aumento del dolor, vómitos, taquicardia o hipotensión.', '2025-11-18 22:50:50.346956', 1, 'Diagnóstico presuntivo: Apendicitis aguda no complicada.', 'Paciente masculino de 21 años que acude a emergencias por presentar dolor abdominal intenso de inicio súbito, localizado en fosa ilíaca derecha, acompañado de náuseas, un episodio de vómito y febrícula desde hace 12 horas.'),
	(2, 'Durante las últimas 24 horas el paciente presentó mejoría progresiva del dolor abdominal. Actualmente refiere dolor mínimo (1/10), no localizado y sin irradiación. Abdomen blando, depresible, sin defensa ni rebote. Tolera vía oral sin náuseas ni vómitos.\r\n\r\nSe repitieron laboratorios de control mostrando leucocitos: 8,200/mm³, PCR en rango normal y sin datos de infección activa. Signos vitales mantenidos dentro de parámetros fisiológicos. El paciente se encuentra hemodinámicamente estable, hidratado y con buen estado general.\r\n\r\nNo se realizó intervención quirúrgica debido a evolución favorable del cuadro. El paciente ha podido movilizarse, ingerir alimentos blandos y no refiere molestias significativas.\r\n\r\nEl paciente permanece alerta, orientado, colaborador y expresa comprensión de indicaciones de seguimiento.\r\n\r\nCondición actual: estable, asintomático y apto para alta hospitalaria.', '- Retirar acceso venoso periférico tras finalizar hidratación.\r\n- Verificar tolerancia a la dieta oral.\r\n- Educar al paciente sobre signos de alarma y cuidados en domicilio.\r\n- Registrar signos vitales previos al alta.\r\n- Entregar prescripción médica y recomendaciones.', '2025-11-22 19:32:58.316726', 1, 'Dolor abdominal resuelto; apendicitis descartada clínicamente tras evolución favorable y estudios complementarios dentro de límites normales. Cuadro compatible con adenitis mesentérica leve autolimitada.', 'Paciente masculino de 21 años que acude a emergencias por presentar dolor abdominal intenso de inicio súbito, localizado en fosa ilíaca derecha, acompañado de náuseas, un episodio de vómito y febrícula desde hace 12 horas.');
INSERT INTO `hospital_personal_observacionesenfermero` (`id`, `signos_vitales`, `observaciones`, `procedimientos_realizados`, `medicacion_administrada`, `fecha_y_horario`, `asignacion_enfermero_id`) VALUES
	(1, 'TA: 118/72 mmHg\r\nFC: 84 lpm\r\nFR: 18 rpm\r\nTemp: 37.4 °C\r\nSatO₂: 98% aire ambiente\r\nGlasgow: 15/15', 'Paciente despierto, alerta y orientado en tiempo, espacio y persona. Refiere dolor abdominal leve (3/10), localizado en fosa ilíaca derecha, sin aumento respecto al turno previo. Abdomen ligeramente sensible a la palpación, sin signos de rebote. Se observa adecuado estado de hidratación y mucosas húmedas.\r\nEl paciente permanece en ayuno según indicación médica, tolerando sin dificultad. No presenta náuseas ni vómitos desde la guardia anterior. Diuresis espontánea conservada.\r\nHerida quirúrgica aún no realizada; paciente en preparación preoperatoria a la espera de disponibilidad quirúrgica. Apoya adecuadamente el tratamiento y comprende las indicaciones brindadas. Sin signos de deterioro clínico.', 'Verificación y mantenimiento de acceso venoso periférico en miembro superior izquierdo; sin signos de infiltración o flebitis.\r\nControl de signos vitales y valoración del dolor.\r\nSe realiza higiene y confort.', 'Paracetamol 1 g IV a las 09:00 hs. Paciente refiere disminución del dolor posterior a la administración.\r\nCeftriaxona 1 g IV en perfusión lenta a las 10:00 hs, sin reacciones adversas.\r\nSueroterapia: Solución fisiológica al 0.9% a 80 ml/h según indicación médica, acceso permeable.', '2025-11-19 22:39:37.264942', 1),
	(2, '- TA: 116/70 mmHg\r\n- FC: 76 lpm\r\n- FR: 16 rpm\r\n- Temp: 36.8 °C\r\n- SatO₂: 98% aire ambiente\r\n- Glasgow: 15/15', 'Paciente despierto, alerta y orientado en las tres esferas. Refiere dolor abdominal leve ocasional (1/10), sin signos de irritación peritoneal. Abdomen normotenso y no doloroso a palpación. Tolera dieta blanda sin náuseas ni vómitos. Marcha estable.\r\n\r\nMucosas húmedas, hidratación conservada. Micción y eliminación dentro de parámetros normales. El paciente se encuentra tranquilo, comprende las instrucciones para el alta y no manifiesta inquietudes.\r\n\r\nSignos vitales se mantienen estables y sin cambios respecto al turno previo.', '- Control y mantenimiento final de acceso venoso periférico.\r\n- Registro de signos vitales y valoración del dolor.\r\n- Retiro de sueroterapia y acceso venoso sin complicaciones.\r\n- Educación al paciente sobre cuidados post-alta y signos de alarma.', '- Paracetamol 1 g VO a las 08:00 hs, con buena respuesta.\r\n- No se administran más antibióticos debido a evolución favorable.\r\n- Hidratación IV suspendida tras confirmar tolerancia oral adecuada.', '2025-11-22 19:36:48.117533', 1);
INSERT INTO `hospital_personal_altamedica` (`id`, `fecha_alta`, `diagnostico_principal`, `diagnosticos_secundarios`, `tratamiento_realizado`, `indicaciones_post_alta`, `asignacion_medico_id`) VALUES
	(1, '2025-11-22 21:42:18.005616', 'Dolor abdominal agudo resuelto; cuadro compatible con adenitis mesentérica leve autolimitada.', 'Estado post-observación por sospecha de apendicitis aguda no complicada (no quirúrgica).', '- Hidratación intravenosa durante la observación inicial.\r\n- Analgesia: Paracetamol IV y VO según necesidad.\r\n- Antibiótico profiláctico: Ceftriaxona IV (suspendido al demostrar evolución favorable).\r\n- Monitoreo de signos vitales y control de dolor abdominal.\r\n- Observación clínica hasta resolución de síntomas.', '- Mantener hidratación adecuada y dieta balanceada (preferir alimentos blandos durante las primeras 48 h).\r\n- Analgesia en domicilio: Paracetamol 500 mg cada 8 h si aparece dolor leve.\r\n- Evitar esfuerzos físicos intensos por 48–72 h.\r\n- Control médico ambulatorio en 48–72 h.\r\n- Signos de alarma: acudir a urgencias si presenta fiebre >38 °C, vómitos persistentes, dolor abdominal progresivo, ictericia, sangrado digestivo o cualquier síntoma preocupante.\r\n- Paciente informado y comprende las indicaciones.', 1);
INSERT INTO `hospital_personal_altaadministrativa` (`id`, `fecha_cierre`, `asignacion_habitacion_id`, `responsable_id`) VALUES
